وهو أكبر مسجد في الجزائر يتسع ل 15000 مصلى بالإضافة إلى ساحة واسعة يمكن أن تضم ألاف أخرى يقع في قلب مدينة قسنطينة عاصمة الشرق الجزائري على طريق قدور بومدوس بمحاذاة محطة التلفزيون الجزائري ويضم كذالك جامعة العلوم الإسلامية

🌸🌸تاريخ المسجد🌸🌸
يعتبر من أكبر المساجد شمال إفريقيا، يتميز بعلو مئذنتيه اللتين يبلغ ارتفاع كل واحدة 107م وارتفاع قبته64م، يبهرك منظره بهندسته المعمارية الرائعة ويعدّ إحدى التحف التي أبدعتها يد الإنسان في العصر الحاضر، وإن إنجازه بهذا التصميم على النمط المشرقي الأندلسي، كان ثمرة تعاون بين بعض المهندسين والتقنيين من مصريين ومغاربة، إضافة إلى المساهمة الكبيرة للمهندسين والفنيين والعمال الجزائريين،  ويهزك مسجد الأمير بمجرد ولوجك إليه بزخرفته الراقية وباحتوائه على أضخم ثريّا بالجزائر وأشكال جمالية أبدع فيها جزائريون وعرب. يطل على الأربع جهات نحو المنظر الجميل، واحد من أرقى أحياء قسنطينة، و حي فيلالي والجامعة المركزية و حي قدور بومدوس.

🌸🌸بناء مسجد الأمير عبد القادر الذي يعد إلى جانب الجامعة آية من آيات الفن المعماري الإسلامي و قد أسهم في إنجازها عدد كبير من المعماريين المسلمين المختصين في العمارة الإسلامية من ذوي الكفاءات العالية.
